(2019, 80, 0, 'FormattedText', '<h3>SERVICES PROVIDED</h3><ol start=\"1\"><li>The Client hereby agrees to engage the Contractor to provide the Client with the following services (the \"Services\"):<ul><li><p>[pipe:22]</p></li></ul></li><li>The Services will also include any other tasks which the Parties may agree on. The Contractor hereby agrees to provide such Services to the Client.</li></ol><h3>TERM OF AGREEMENT</h3><ol start=\"3\"><li>The term of this Agreement (the \"Term\") will begin on the date of this Agreement and will remain in full force and effect until the completion of the Services, subject to earlier termination as provided in this Agreement. The Term of this Agreement may be extended with the written consent of the Parties.</li><li>In the event that either Party wishes to terminate this Agreement prior to the completion of the Services, that Party will be required to provide 10 days\' written notice to the other Party.</li></ol><h3>PERFORMANCE</h3><ol start=\"5\"><li>The Parties agree to do everything necessary to ensure that the terms of this Agreement take effect.</li></ol><h3>CURRENCY</h3><ol start=\"6\"><li>Except as otherwise provided in this Agreement, all monetary amounts referred to in this Agreement are in USD (US Dollars).</li></ol><h3>COMPENSATION</h3><ol start=\"7\"><li>The Contractor will charge the Client a flat fee of $[pipe:27] for the Services (the \"Compensation\").</li><li>The Client will be invoiced when the Services are complete.</li><li>Invoices submitted by the Contractor to the Client are due within 30 days of receipt.</li><li>In the event that this Agreement is terminated by the Client prior to completion of the Services but where the Services have been partially performed, the Contractor will be entitled to pro rata payment of the Compensation to the date of termination provided that there has been no breach of contract on the part of the Contractor.</li></ol><h3>REIMBURSEMENT OF EXPENSES</h3><ol start=\"11\"><li>The Contractor will be reimbursed from time to time for reasonable and necessary expenses incurred by the Contractor in connection with providing the Services.</li><li>All expenses must be pre-approved by the Client.</li></ol><h3>CONFIDENTIALITY</h3><ol start=\"13\"><li>Confidential information (the \"Confidential Information\") refers to any data or information relating to the Client, whether business or personal, which would reasonably be considered to be private or proprietary to the Client and that is not generally known and where the release of that Confidential Information could reasonably be expected to cause harm to the Client.</li><li>The Contractor agrees that they will not disclose, divulge, reveal, report or use, for any purpose, any confidential information which the Contractor has obtained, except as authorized by the Client or as required by law. The obligations of confidentiality will apply during the term of this Agreement and will survive indefinitely upon termination of this Agreement.</li><li>All written and oral information and material disclosed or provided by the Client to the Contractor under this Agreement is Confidential Information regardless of whether it was provided before or after the date of this Agreement or how it was provided to the Contractor.</li></ol><h3>OWNERSHIP OF INTELLECTUAL PROPERTY</h3><ol start=\"16\"><li>All intellectual property and related material, including any trade secrets, moral rights, goodwill, relevant registrations or applications for registration, and rights in any patent, copyright, trademark, trade dress, industrial design and trade name (the \"Intellectual Property\") that is developed or produced under this Agreement, is a \"work made for hire\" and will be the sole property of the Client. The use of the Intellectual Property by the Client will not be restricted in any manner.</li><li>The Contractor may not use the Intellectual Property for any purpose other than that contracted for in this Agreement except with t