(254, 16, 0, 'FormattedText', '<p>This <strong>GENERAL SERVICE AGREEMENT</strong> (the \"Agreement\") on [pipe:15] is between [pipe:8] (the \"client\") and [pipe:25] (the \"contractor\").</p><h3>FOUNDATION</h3><p>The Client believes that the Contractor has the necessary qualifications, experience and abilities to provide services to the Client and the Contractor is agreeable to providing such services to the Client on the terms and conditions set out in this Agreement.</p><p><strong>IN CONSIDERATION OF</strong> the matters described above and of the mutual benefits and obligations set forth in this Agreement, the receipt and sufficiency of which consideration is hereby acknowledged, the Client and the Contractor (individually the \"Party\" and collectively the \"Parties\" to this Agreement) agree as follows:</p>', 0, 0, 0, 0, 'characters', '', 12, 1, 0, 0, 0, '', 0, 11, '', '', '', '', '', '', '', 'show', 'any', 0, 0, 0, '', 30, 0, 'left', 'top');
