(255, 16, 0, 'FormattedText', '<h3>SERVICES PROVIDED</h3><ol start=\"1\"><li>The Client hereby agrees to engage the Contractor to provide the Client with the following services (the \"Services\"):<ul><li><p>[pipe:22]</p></li></ul></li><li>The Services will also include any other tasks which the Parties may agree on. The Contractor hereby agrees to provide such Services to the Client.</li></ol><h3>TERM OF AGREEMENT</h3><ol start=\"3\"><li>The term of this Agreement (the \"Term\") will begin on the date of this Agreement and will remain in full force and effect until the completion of the Services, subject to earlier termination as provided in this Agreement. The Term of this Agreement may be extended with the written consent of the Parties.</li><li>In the event that either Party wishes to terminate this Agreement prior to the completion of the Services, that Party will be required to provide 10 days\' written notice to the other Party.</li></ol><h3>PERFORMANCE</h3><ol start=\"5\"><li>The Parties agree to do everything necessary to ensure that the terms of this Agreement take effect.</li></ol><h3>CURRENCY</h3><ol start=\"6\"><li>Except as otherwise provided in this Agreement, all monetary amounts referred to in this Agreement are in USD (US Dollars).</li></ol><h3>COMPENSATION</h3><ol start=\"7\"><li>The Contractor will charge the Client a flat fee of $[pipe:27] for the Services (the \"Compensation\").</li><li>The Client will be invoiced when the Services are complete.</li><li>Invoices submitted by the Contractor to the Client are due within 30 days of receipt.</li><li>In the event that this Agreement is terminated by the Client prior to completion of the Services but where the Services have been partially performed, the Contractor will be entitled to pro rata payment of the Compensation to the date of termination provided that there has been no breach of contract on the part of the Contractor.</li></ol><h3>REIMBURSEMENT OF EXPENSES</h3><ol start=\"11\"><li>The Contractor will be reimbursed from time to time for reasonable and necessary expenses incurred by the Contractor in connection with providing the Services.</li><li>All expenses must be pre-approved by the Client.</li></ol><h3>CONFIDENTIALITY</h3><ol start=\"13\"><li>Confidential information (the \"Confidential Information\") refers to any data or information relating to the Client, whether business or personal, which would reasonably be considered to be private or proprietary to the Client and that is not generally known and where the release of that Confidential Information could reasonably be expected to cause harm to the Client.</li><li>The Contractor agrees that they will not disclose, divulge, reveal, report or use, for any purpose, any confidential information which the Contractor has obtained, except as authorized by the Client or as required by law. The obligations of confidentiality will apply during the term of this Agreement and will survive indefinitely upon termination of this Agreement.</li><li>All written and oral information and material disclosed or provided by the Client to the Contractor under this Agreement is Confidential Information regardless of whether it was provided before or after the date of this Agreement or how it was provided to the Contractor.</li></ol><h3>OWNERSHIP OF INTELLECTUAL PROPERTY</h3><ol start=\"16\"><li>All intellectual property and related material, including any trade secrets, moral rights, goodwill, relevant registrations or applications for registration, and rights in any patent, copyright, trademark, trade dress, industrial design and trade name (the \"Intellectual Property\") that is developed or produced under this Agreement, is a \"work made for hire\" and will be the sole property of the Client. The use of the Intellectual Property by the Client will not be restricted in any manner.</li><li>The Contractor may not use the Intellectual Property for any purpose other than that contracted for in this Agreement except with the written consent of the Client. The Contractor will be responsible for any and all damages resulting from the unauthorized use of the Intellectual Property.</li></ol><h3>RETURN OF PROPERTY</h3><ol start=\"18\"><li>Upon the expiry or termination of this Agreement, the Contractor will return to the Client any property, documentation, records, or Confidential Information which is the property of the Client.</li><li>In the event that this Agreement is terminated by the Client prior to completion of the Services the Contractor will be entitled to recovery from the site or premises where the Services were carried out, of any materials or equipment which is the property of the Contractor or, where agreed between the Parties, to compensation in lieu of recovery.</li></ol><h3>CAPACITY/INDEPENDENT CONTRACTOR</h3><ol start=\"20\"><li>In providing the Services under this Agreement it is expressly agreed that the Contractor is acting as an independent contractor and not as an employee. The Contractor and the Client acknowledge that this Agreement does not create a partnership or joint venture between them, and is exclusively a contract for service. The Client is not required to pay, or make any contributions to, any social security, local, state or federal tax, unemployment compensation, workers\' compensation, insurance premium, profit-sharing, pension or any other employee benefit for the Contractor during the Term. The Contractor is responsible for paying, and complying with reporting requirements for, all local, state and federal taxes related to payments made to the Contractor under this Agreement.</li></ol><h3>NOTICE</h3><ol start=\"21\"><li>All notices, requests, demands or other communications required or permitted by the terms of this Agreement will be given in writing and delivered to the Parties at the following addresses:<br><ol><li><p>[pipe:13]</p></li><li><p>[pipe:26]</p></li></ol>or to such other address as either Party may from time to time notify the other, and will be deemed to be properly delivered (a) immediately upon being served personally, (b) two days after being deposited with the postal service if served by registered mail, or (c) the following day after being deposited with an overnight courier.</li></ol><h3>INDEMNIFICATION</h3><ol start=\"22\"><li>Except to the extent paid in settlement from any applicable insurance policies, and to the extent permitted by applicable law, each Party agrees to indemnify and hold harmless the other Party, and its respective affiliates, officers, agents, employees, and permitted successors and assigns against any and all claims, losses, damages, liabilities, penalties, punitive damages, expenses, reasonable legal fees and costs of any kind or amount whatsoever, which result from or arise out of any act or omission of the indemnifying party, its respective affiliates, officers, agents, employees, and permitted successors and assigns that occurs in connection with this Agreement. This indemnification will survive the termination of this Agreement.</li></ol><h3>MODIFICATION OF AGREEMENT</h3><ol start=\"23\"><li>Any amendment or modification of this Agreement or additional obligation assumed by either Party in connection with this Agreement will only be binding if evidenced in writing signed by each Party or an authorized representative of each Party.</li></ol><h3>TIME OF THE ESSENCE</h3><ol start=\"24\"><li>Time is of the essence in this Agreement. No extension or variation of this Agreement will operate as a waiver of this provision.</li></ol><h3>ASSIGNMENT</h3><ol start=\"25\"><li>The Contractor will not voluntarily, or by operation of law, assign or otherwise transfer its obligations under this Agreement without the prior written consent of the Client.</li></ol><h3>ENTIRE AGREEMENT</h3><ol start=\"26\"><li>It is agreed that there is no representation, warranty, collateral agreement or condition affecting this Agreement except as expressly provided in this Agreement.</li></ol><h3>ENUREMENT</h3><ol start=\"27\"><li>This Agreement will enure to the benefit of and be binding on the Parties and their respective heirs, executors, administrators and permitted successors and assigns.</li></ol><h3>TITLES/HEADINGS</h3><ol start=\"28\"><li>Headings are inserted for the convenience of the Parties only and are not to be considered when interpreting this Agreement.</li></ol><h3>GENDER</h3><ol start=\"29\"><li>Words in the singular mean and include the plural and vice versa. Words in the masculine mean and include the feminine and vice versa.</li></ol><h3>GOVERNING LAW</h3><ol start=\"30\"><li>This Agreement will be governed by and construed in accordance with the laws of the country, state, and/or province where the service is performed.</li></ol><h3>SEVERABILITY</h3><ol start=\"31\"><li>In the event that any of the provisions of this Agreement are held to be invalid or unenforceable in whole or in part, all other provisions will nevertheless continue to be valid and enforceable with the invalid or unenforceable parts severed from the remainder of this Agreement.</li></ol><h3>WAIVER</h3><ol start=\"32\"><li>The waiver by either Party of a breach, default, delay or omission of any of the provisions of this Agreement by the other Party will not be construed as a waiver of any subsequent breach of the same or other provisions.</li></ol><div>IN WITNESS WHEREOF the Parties have duly affixed their signatures under hand and seal today</div>', 0, 0, 0, 0, 'characters', '', 12, 3, 0, 0, 0, '', 0, 12, '', '', '', '', '', '', '', 'show', 'any', 0, 0, 0, '', 30, 0, 'left', 'top'),
