(4, 2, 'work_order_completed', 'P1D', 0, 'Work Order Complete', 'Due for next service', '<p>Dear {{customer.name}},<br><br>We last cleaned your carpet on more than six months ago.<br><br>You can click below to schedule your next service within 7 days and we&#39;ll give you 20% off!<br><br><strong><a href=\"https://www.markate.com/pro/settings/automation/email/edit/id/{{widget_booking.url}}\">Online Booking</a></strong><br><br>We can afford to do this because we can clean your carpets better and more efficiently when there has been less accumulated dirt, spills and stains. The final result is that our cleaning time is reduced and you will maintain your carpet better, keep a cleaner home, and save money on your carpet cleaning.<br><br>Our service comes with a 100% satisfaction guarantee.<br><br>You are a valued client. Thank you for letting us serve you!<br><br>Sincerely,<br>{{business.name}}<br>{{business.email}}<br>{{business.phone}}</p><p>{{customer.email}}</p>', 0, 2, 1, 1, '2020-10-03 00:49:40', NULL);
